// import { useState } from "react";

// @mui material components
import Grid from "@mui/material/Grid";
// import Card from "@mui/material/Card";
// import Divider from "@mui/material/Divider";
// import Switch from "@mui/material/Switch";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";

// import SuiInput from "components/SuiInput";
// import SuiSelect from "components/SuiSelect";
// import SuiDatePicker from "components/SuiDatePicker";
// import SuiEditor from "components/SuiEditor";
// import SuiDropzone from "components/SuiDropzone";
// import SuiButton from "components/SuiButton";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";


import { Table } from 'react-bootstrap';

function NewProject() {

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox mt={3} mb={4}>
       <Grid container>
          <Grid item xs={12} md={10} lg={12} py={3}>
            <Grid item xs={15} lg={12}>
              <SuiBox mb={3}>
              <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>
                <thead>
                  <tr>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/amcwisestp">AMC Wise STP </a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/schemewisestp">Scheme Wise STP </a></th>
                    <th style={{ padding: "15px", borderColor: 'white', width: '200px' }}>Client Wise STP</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/maturingstp">STP Maturing in 1 Month</a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/maturingstp">STP Started In Last 1 Month</a></th>

                  </tr>
                </thead>
              </Table>
              <br/>

                <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                  <thead>
                  <tr>
                    <th style={{  backgroundColor: "rgb(249, 221, 171)", padding: "15px"}}>Client Name</th>
                    <th style={{  backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Pan Number</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px"}}>STP Amount</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px"}}>No Of SIPS</th>
                  </tr>
                  </thead>

                  <tbody>
                  <tr>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" , padding:'10px'}}>Total</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>Nill</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>0</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>0</td>
                  </tr>
                  </tbody>
                </Table>
              </SuiBox>
            </Grid>
          </Grid>
        </Grid>
      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default NewProject;
